    false,nt"url": null,nt"notes": "This dataset contains oceanographic data
    collected in the Commonwealth of the Northern Marianas Islands (CNMI), beginning
    in Mutan, Saipan and concluding in Santa Rita, Guam. Exploration operations for
    this cruise focused on deep-water areas near the northern edge of CNMI and the Trench
    and Islands units of the Marianas Trench Marine National Monument (MTMNM). Operations
    used the shipu00e2u0080u0099s deep water mapping systems and the shipu00e2u0080u0099s
    high-bandwidth satellite connection for periodic real-time ship to shore communications.
    This leg of the CAPSTONE Expeditions was a 24-hour mapping cruise that focused on
    previously unmapped sites within the CNMI US EEZ and MTMNM, all of which occurred
    in U.S. waters.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
